    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col2 NOT BETWEEN + + col0 * 68 AND - col1 * - - col1;
  - name: tab1

outputs:
  - name: q2567.out
    data: |
      51	14	96
      85	5	59
      91	47	68
